contract BNBC is Context, IERC20, IERC20Metadata, Ownable {
    using SafeMath for uint256;
    using Address for address;
    uint256 private constant maxSupply =     100000 * 1e18;     // the total supply
    using EnumerableSet for EnumerableSet.AddressSet;
    EnumerableSet.AddressSet private _whitelist;
    EnumerableSet.AddressSet private _lplist;
    

    IUniswapV2Router02 public uniswapV2Router;
    address public uniswapV2Pair;
    uint256 public buyliquidityRate=50;
    uint256 public buybonusFee=20;
    uint256 public buyLpbonusFee=30;


    uint256 public sellliquidityRate=50;
    uint256 public sellbonusFee=20;
    uint256 public sellLpbonusFee=30;

    uint256 public transbonusFee=40;
    uint256 public transLpbonusFee=60;
    uint256 public transliquidityRate=100;

    uint256 public baseRate=1000;  

    address public bonusAddr; 
    address public lpbonusAddr;

    address public _tokenOwner;

    uint256 public numTokensSellToLiquidity=10**18*10;
    
    bool public startTrade=true;

    mapping(address => uint256) private _balances;

    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 private _totalSupply;

    string private _name;
    string private _symbol;
 

    function name() public view virtual override returns (string memory) {
        return _name;
    }

    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual override returns (uint8) {
        return 18;
    }

    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view virtual override returns (uint256) {
        return _balances[account];
    }

    function transfer(address to, uint256 amount) public virtual override returns (bool) {
        address owner = _msgSender();
        _transfer(owner, to, amount);
        return true;
    }

    function allowance(address owner, address spender) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public virtual override returns (bool) {
        address owner = _msgSender();
        _approve(owner, spender, amount);
        return true;
    }

    function transferFrom(address from, address to, uint256 amount) public virtual override returns (bool) {
        address spender = _msgSender();
        _spendAllowance(from, spender, amount);
        _transfer(from, to, amount);
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        address owner = _msgSender();
        _approve(owner, spender, allowance(owner, spender) + addedValue);
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        address owner = _msgSender();
        uint256 currentAllowance = allowance(owner, spender);
        require(currentAllowance >= subtractedValue, "ERC20: decreased allowance below zero");
        unchecked {
            _approve(owner, spender, currentAllowance - subtractedValue);
        }

        return true;
    }

    function _transferInternal(address from, address to, uint256 amount) internal virtual {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");

        _beforeTokenTransfer(from, to, amount);

        uint256 fromBalance = _balances[from];
        require(fromBalance >= amount, "ERC20: transfer amount exceeds balance");
        unchecked {
            _balances[from] = fromBalance - amount;
            // Overflow not possible: the sum of all balances is capped by totalSupply, and the sum is preserved by
            // decrementing then incrementing.
            _balances[to] += amount;
        }

        emit Transfer(from, to, amount);

        _afterTokenTransfer(from, to, amount);
    }
    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _beforeTokenTransfer(address(0), account, amount);

        _totalSupply += amount;
        unchecked {
            // Overflow not possible: balance + amount is at most totalSupply + amount, which is checked above.
            _balances[account] += amount;
        }
        emit Transfer(address(0), account, amount);

        _afterTokenTransfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _beforeTokenTransfer(account, address(0), amount);

        uint256 accountBalance = _balances[account];
        require(accountBalance >= amount, "ERC20: burn amount exceeds balance");
        unchecked {
            _balances[account] = accountBalance - amount;
            // Overflow not possible: amount <= accountBalance <= totalSupply.
            _totalSupply -= amount;
        }

        emit Transfer(account, address(0), amount);

        _afterTokenTransfer(account, address(0), amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _spendAllowance(address owner, address spender, uint256 amount) internal virtual {
        uint256 currentAllowance = allowance(owner, spender);
        if (currentAllowance != type(uint256).max) {
            require(currentAllowance >= amount, "ERC20: insufficient allowance");
            unchecked {
                _approve(owner, spender, currentAllowance - amount);
            }
        }
    }

    function _beforeTokenTransfer(address from, address to, uint256 amount) internal virtual {}

    function _afterTokenTransfer(address from, address to, uint256 amount) internal virtual {}

    function setStartTrade(bool start) public onlyOwner{
        startTrade = start;
    }


    function setBonusFee(uint256 fee,uint256 fee2,uint256 fee3,uint256 fee4,uint256 fee5,uint256 fee6) public onlyOwner{
        buybonusFee = fee;
        sellbonusFee = fee2;
        transbonusFee = fee3;
        buyLpbonusFee = fee4;
        sellLpbonusFee = fee5;
        transLpbonusFee = fee6;
    }

    function setlpbonusAddr(address _lpbonusAddr) public onlyOwner{
        lpbonusAddr = _lpbonusAddr;
    }

    function setRouter(address _router) public onlyOwner{
        uniswapV2Router = IUniswapV2Router02(_router);
    }

    function setNumTokensSellToLiquidity(uint256 _numTokensSellToLiquidity) public onlyOwner{
        numTokensSellToLiquidity=_numTokensSellToLiquidity;
    }

    function setLiquidityRate(uint256 _liquidityRate,uint256 _liquidityRate2,uint256 _liquidityRate3) public onlyOwner{
        buyliquidityRate = _liquidityRate;
        sellliquidityRate = _liquidityRate2;
        transliquidityRate = _liquidityRate3;
    }

    function setbaseRate(uint256 _baseRate) public onlyOwner{
        baseRate=_baseRate;
    }

    function setPair(address _pair) public onlyOwner{
        uniswapV2Pair = _pair;
    }
    function setbonusAddr(address _bonusAddr) public onlyOwner{
        bonusAddr = _bonusAddr;
    }
    function addlplist(address _addlplist) public onlyOwner returns (bool) {
        require(_addlplist != address(0), "MLRToken: _addWhitelist is the zero address");
        return EnumerableSet.add(_lplist, _addlplist);
    }
    function dellplist(address _dellplist) public onlyOwner returns (bool) {
        require(_dellplist != address(0), "MdxToken: _delWhitelist is the zero address");
        return EnumerableSet.remove(_lplist, _dellplist);
    }
    function islplist(address account) public view returns (bool) {
        return EnumerableSet.contains(_lplist, account);
    }
    function addWhitelist(address _addWhitelist) public onlyOwner returns (bool) {
        require(_addWhitelist != address(0), "MLRToken: _addWhitelist is the zero address");
        return EnumerableSet.add(_whitelist, _addWhitelist);
    }
    function delWhitelist(address _delWhitelist) public onlyOwner returns (bool) {
        require(_delWhitelist != address(0), "MdxToken: _delWhitelist is the zero address");
        return EnumerableSet.remove(_whitelist, _delWhitelist);
    }
    function isWhitelist(address account) public view returns (bool) {
        return EnumerableSet.contains(_whitelist, account);
    }

    constructor() {
        _name = "BNBC Token";
        _symbol = "BNBC";
        bonusAddr = 0xA2E81aCEc099f01E946C03B032CD6D6464c6656b;
        lpbonusAddr = 0xc2249c34820E38b10852217508e79e0D72e289C2;
        _tokenOwner =  0xbDC24Dc1F977D1641d18762289De590E758805EA;
        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E);
         // Create a uniswap pair for this new token
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());
        addlplist(uniswapV2Pair);
        addlplist(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        addWhitelist(msg.sender);
        addWhitelist(bonusAddr);
        addWhitelist(lpbonusAddr);
        addWhitelist(_tokenOwner);
        addWhitelist(address(this));
        // set the rest of the contract variables
        uniswapV2Router = _uniswapV2Router;
        _mint(msg.sender, maxSupply);
    }


    function swapTokensForEth(
        uint256 tokenAmount
    ) private lockTheSwap {

        uint256 rewardAmount = tokenAmount.div(2);
        uint256 otherHalf = tokenAmount.sub(rewardAmount);
        _approve(address(this), address(uniswapV2Router), tokenAmount);
        uint256 initialBalance = address(this).balance;
        if (rewardAmount > 0) {
            address[] memory path = new address[](2);
            path[0] = address(this);
            path[1] = uniswapV2Router.WETH();
            uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            rewardAmount,
            0, 
            path,
            address(this),
            block.timestamp
            );
        }
        uint256 newBalance = address(this).balance.sub(initialBalance);

        uniswapV2Router.addLiquidityETH{value: newBalance}(
            address(this),
            otherHalf,
            0,
            0,
            _tokenOwner,
            block.timestamp
        );
    }

    bool public inSwapAndLiquify;
    modifier lockTheSwap {
        inSwapAndLiquify = true;
        _;
        inSwapAndLiquify = false;
    }

    function _isAddLiquidity() internal view returns (bool isAdd) {
        (uint r0, uint256 r1, ) = ISwapPair(uniswapV2Pair).getReserves();
        uint256 r;
        if (uniswapV2Router.WETH() < address(this)) {
            r = r0;
        } else {
            r = r1;
        }

        uint bal = IERC20(uniswapV2Router.WETH()).balanceOf(address(uniswapV2Pair));
        isAdd = bal > r;
        
    }

    function _isRemoveLiquidity() internal view returns (bool isRemove) {
        (uint r0, uint256 r1, ) = ISwapPair(uniswapV2Pair).getReserves();
        uint256 r;
        if (uniswapV2Router.WETH() < address(this)) {
            r = r0;
        } else {
            r = r1;
        }

        uint bal = IERC20(uniswapV2Router.WETH()).balanceOf(address(uniswapV2Pair));
        isRemove = r >= bal;
        
    }

    function getWETH() public view returns(address) {
        return uniswapV2Router.WETH();
    }

    function rescueToken(address tokenAddress, uint256 tokens) public onlyOwner returns (bool success)
    {
        return IERC20(tokenAddress).transfer(msg.sender, tokens);
    }
    function rescueBNB(uint256 tokens) public onlyOwner
    {
        payable(msg.sender).transfer(tokens);
    }

    function _transfer(address sender, address recipient, uint256 amount) internal virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        bool isAdd=false;
        bool isRemove=false;
        if (islplist(recipient)) {
            isAdd = _isAddLiquidity();
        }

        if (islplist(sender)){
            isRemove = _isRemoveLiquidity();
        }

        
        if ((owner()!=sender && owner()!=recipient)&&(islplist(sender)||islplist(recipient))){
            require(startTrade,"trade not begin");
        }
        
        uint256 contractTokenBalance = balanceOf(address(this));
        bool overMinTokenBalance =contractTokenBalance >= numTokensSellToLiquidity;
        if (overMinTokenBalance && _tokenOwner!=sender && _tokenOwner!=recipient &&
            !inSwapAndLiquify &&
            !islplist(sender)&&
            !isAdd){
            contractTokenBalance = numTokensSellToLiquidity;
            //add liquidity
            swapTokensForEth(contractTokenBalance);
        }

        uint256 realAmount = amount;
        uint256 bonusAmount=0;
        uint256 lpbonusAmount=0;
        uint256 liquidityAmount = 0;
        if (!isWhitelist(sender)&&(!isWhitelist(recipient))
                    && islplist(sender) && !islplist(recipient) && !isRemove){ //buy
            liquidityAmount =  amount.mul(buyliquidityRate).div(baseRate);
            bonusAmount = amount.mul(buybonusFee).div(baseRate);
            lpbonusAmount =  amount.mul(buyLpbonusFee).div(baseRate);
            realAmount = amount.sub(liquidityAmount).sub(bonusAmount).sub(lpbonusAmount);
        }else if ((!isWhitelist(sender)&&(!isWhitelist(recipient)))
                    && islplist(recipient) && !islplist(sender)&& !isAdd) {//sell
            liquidityAmount =  amount.mul(sellliquidityRate).div(baseRate);
            bonusAmount = amount.mul(sellbonusFee).div(baseRate);
            lpbonusAmount =  amount.mul(sellLpbonusFee).div(baseRate);
            realAmount = amount.sub(liquidityAmount+bonusAmount+lpbonusAmount);
        }else if (!isWhitelist(sender)&& !isWhitelist(recipient)&& !islplist(recipient)&& !islplist(sender)){
            liquidityAmount =  amount.mul(transliquidityRate).div(baseRate);
            bonusAmount = amount.mul(transbonusFee).div(baseRate);
            lpbonusAmount =  amount.mul(transLpbonusFee).div(baseRate);
            realAmount = amount.sub(liquidityAmount+bonusAmount+lpbonusAmount); //transfer
        }


        _transferInternal(sender, recipient, realAmount);
        if (liquidityAmount>0){
            _transferInternal(sender, address(this), liquidityAmount); 
        }
        if(bonusAmount>0){
            _transferInternal(sender,bonusAddr,bonusAmount);
        }
        if(lpbonusAmount>0){
            _transferInternal(sender,lpbonusAddr,lpbonusAmount);
        }
    }

    receive() external payable {}
}
